import React from 'react'
import styled from 'styled-components'

const Container = styled.div``
const Register = () => {
  return (
    <Container>
      <Wrapper>
        <Title>CREATE AN ACCOUNT</Title>
      </Wrapper>
    </Container>
  )
}

export default Register
